//This is A COMPONENT of index.js. It is a function that returns a React element that displays the real-time date and time.
//
//

import React from 'react';
import './App.css';


function App() {
  return (

    <div className="App">
        <header className="App-header">
            <h1>Current Date and Time</h1>
            <h2>{new Date().toLocaleDateString()}</h2>
            <h2>{new Date().toLocaleTimeString()}</h2>
        </header>


    </div>
  );
}

export default App;
